INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, 0, 0, 0, "春咲 ひより", 1001, "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 0, "お！\nあそこに困ってそうな人発見！", 1, 1, 2, 1, "ねぇねぇ、騎士クン\n手伝ってあげようよ～", 1.4);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, 0, 0, 0, "草野 優衣", 1002, "みんなみたいに\nわたしも強くならなきゃ", 0, "大切な人を\n守れるようになりたい…って", 1, 1, 2, 1, "わ、わたし、\nなに言ってるんだろ\nあはは…", 1.4);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, 0, 0, 0, "士条 怜", 1003, "フェンシングを始めてみては？", 0, "キミに必要な集中力と感性が", 1, 1, 2, 1, "少しは磨かれると思いますよ。", 1.4);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, 0, 0, 0, "穂高 みそぎ", 1004, "ねぇ、にいちゃん！", 0, "今日はなにして遊ぶ？", 1, 1, 2, 1, "みそぎはねぇ、\nかくれんぼやりたい！", 1.5);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, 0, 0, 0, "風宮 あかり", 1006, "風宮あかりです", 0, "ねぇ…", 1, 1, 2, 1, "私といっしょに…\nいかない？", 1.4);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, 0, 0, 0, "出雲 宮子", 1007, "出雲宮子なのー", 0, "プリンたべたいのー", 1, 1, 2, 1, "食べ物の恨みは怖いのー", 1.5);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, 0, 0, 0, "虹村 雪", 1008, "ボクは虹村雪。", 0, "キミもボクの美貌に\n吸い寄せられたんだね。", 1, 1, 2, 1, "いいよ。\n見られることは運命さ…", 1.4);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, 0, 0, 0, "柊杏奈", 1009, "フッ…聞いて後悔するがいい！", 0, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", 1, 1, 2, 1, "人呼んで「疾風の冥姫」!!", 1.4);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, 0, 0, 0, "姫宮 真歩", 1010, "マホマホ王国のプリンセス、\nまほ姫どす", 0, "うさぎさん、\n運命の王子はんに巡りあわせてくれて", 1, 1, 2, 1, "ほんまおおきにやわ～♪", 1.5);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, 0, 0, 0, "衣之咲 璃乃", 1011, "衣之咲璃乃です！", 0, "生き別れたお兄ちゃんを探して\n三千世界！", 1, 1, 2, 1, "ここで会ったが\n100年目～！", 1.4);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, 0, 0, 0, "柏崎 初音", 1012, "私はハツネ、\n結構強いんだよ。\nきらーん☆", 0, "ち、超能力って…\n何のことかな～？", 1, 1, 2, 1, "…って、お願い！\n誰にも言わないでおいて～！", 1.4);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, 0, 0, 0, "美波 鈴奈", 1016, "ちょす！\n美波鈴奈だよ～♪", 0, "一応カリスマ読モJKやってまっす！", 1, 1, 2, 1, "ヒデサイまぢ\nGF（グッドフィーリング）～♪", 1.4);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, 0, 0, 0, "喜屋武 香織", 1017, "はいたーい。\n喜屋武香織さー。", 0, "東京は遊園地みたいなところさー", 1, 1, 2, 1, "でも、沖縄もとってもいいとこさー", 1.4);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, 0, 0, 0, "支倉 伊緒", 1018, "支倉伊緒です。", 0, "先生って呼ばれるのは\nくすぐったいから", 1, 1, 2, 1, "イオちゃんって呼んでね。", 1.4);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, 0, 0, 0, "茜 ミミ", 1020, "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 0, "あ！/\お兄ちゃ～ん\nまってよ～", 1, 1, 2, 1, "ミミをおいてかないでぇ～", 1.5);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, 0, 0, 0, "栗林 くるみ", 1021, "あ…あの…えっと…\n栗…林…くるみ…です……", 0, "あの……\nふぇ……", 1, 1, 2, 1, "ふぇぇぇぇぇん……", 1.5);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, 0, 0, 0, "風宮 より", 1022, "風宮よりです。\nあああああ！", 0, "こんな私に貴重な時間を\n割いていただき、", 1, 1, 2, 1, "なんてありがとうございます！", 1.4);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, 0, 0, 0, "北条 綾音", 1023, "私、アヤネ！\nぷうきちと一緒についてってあげるね！", 0, "おにいちゃんどこいくの？\nえ？", 1, 1, 2, 1, "私こっち行きたいー\nね、早く早くー", 1.5);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, 0, 0, 0, "天野 すずめ", 1025, "わっ…わっ…私、\n天野すずめといいます！", 0, "ふ、不束者ですが\nどうぞ末永く…って、", 1, 1, 2, 1, "これて何か違う…\nあああすみません！", 1.4);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, 0, 0, 0, "倉石 恵理子", 1027, "……クスクス…私は\n…倉石恵理子……", 0, "あなたは…運命の……\n伴侶……", 1, 1, 2, 1, "離しませんわ………\n絶対に…!!", 1.4);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, 0, 0, 0, "佐々木 咲恋", 1028, "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 0, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", 1, 1, 2, 1, "…そうでしょ？？", 1.4);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, 0, 0, 0, "桜井 望", 1029, "桜井望だよ！\nよろしくねっ", 0, "ぇっと…\nキミ、私のこと知らないの?!", 1, 1, 2, 1, "あはは、\n私もまだまだだなぁ～", 1.4);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, 0, 0, 0, "ニノン・ジュベール", 1030, "デケデケデンっ！", 0, "初めまして、\n私はニノン・ジュベール申すデス！", 1, 1, 2, 1, "ショーグン、\nワタシと一緒に天下統一デース！", 1.4);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, 0, 0, 0, "上喜 しのぶ", 1031, "上喜しのぶです。\n手元のドクロが父です。", 0, "でもって私の隣にいるのが……\nえ、見えない？", 1, 1, 2, 1, "おかしいですね……", 1.4);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, 0, 0, 0, "野戸まひる", 1033, "目指すはビッグな\nお笑い芸人だっぺ！", 0, "けんども\nそれには足りないモンが…", 1, 1, 2, 1, "そう、\nオラのボケに突っ込める相方が…！", 1.5);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, 0, 0, 0, "綾瀬 ゆかり", 1034, "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 0, "ちょっと緊張しちゃって…", 1, 1, 2, 1, "ちょ\nちょっと一杯飲んできます…！", 1.4);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, 0, 0, 0, "氷川 鏡華", 1036, "氷川鏡華…です", 0, "知らない人とは話しちゃいけないので", 1, 1, 2, 1, "これ以上お話しすることは…\nないです！", 1.5);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, 0, 0, 0, "柏崎 栞", 1038, "柏崎…栞です。", 0, "……あ、アラーム。", 1, 1, 2, 1, "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", 1.4);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, 0, 0, 0, "双葉 碧", 1040, "ふ、双葉碧です。", 0, "私、一人も友達がいなくて……", 1, 1, 2, 1, "野に咲く花が、\n唯一の話相手です。", 1.4);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, 0, 0, 0, "三角 千歌", 1042, "三角千歌です。", 0, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", 1, 1, 2, 1, "そう思っています。", 1.4);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, 0, 0, 0, "安芸 真琴", 1043, "安芸真琴だ。", 0, "あぁ？\nお前のそいつの仲間か？", 1, 1, 2, 1, "う、疑ってすまなかったな…", 1.4);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, 0, 0, 0, "イリヤ・オーンスタイン", 1044, "わらわこそは夜を総べる者！", 0, "生けとし生ける全ての者よ！", 1, 1, 2, 1, "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", 1.4);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, 0, 0, 0, "遠見 空花", 1045, "そこで騎士は妖精を乱暴に……", 0, "ぐふふふふ……はっ！", 1, 1, 2, 1, "ｌク、クウカに何かご用ですか!?", 1.4);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, 0, 0, 0, "宮坂たまき", 1046, "宮坂たまきにゃ♪\n猫はいいにゃよ？", 0, "自由気ままで♪\n寝て遊んで、食べてケンカして…", 1, 1, 2, 1, "う～ん…\n猫ってホントに最高にゃ～♪", 1.4);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, 0, 0, 0, "大神 美冬", 1048, "大神美冬よ！", 0, "それでは早速クエストに…", 1, 1, 2, 1, "…と思ったら\nバイトの時間だ！\nまたあとでね！", 1.4);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, 0, 0, 0, "星野静流", 1049, "星野静流だよ！", 0, "クエストもバトルも\n掃除も洗濯も", 1, 1, 2, 1, "お姉ちゃんがぜ～んぶ\nやってあげるからね！", 1.4);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, 0, 0, 0, "玉泉美咲", 1050, "アタシは玉泉美咲。", 0, "見ての通りの\nセクシー美少女で", 1, 1, 2, 1, "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", 1.5);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, 0, 0, 0, "リマ", 1052, "？？？", 0, "？？？？", 1, 1, 2, 1, "？？？？", 1.4);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, 0, 0, 0, "モニカ・ヴァイスヴィント", 1053, "モニカ・ヴァイスヴィントだ。", 0, "菓子でつろうなどと\n稚拙な策を……", 1, 1, 2, 1, "そ、そこまでいうなら\nもらってやる", 1.5);
